import React from 'react';

class App extends React.Component {
  constructor(props) {
    super (props)

    this.state = { lat: null }

    window.navigator.geolocation.getCurrentPosition(
      GeolocationPosition => {
        this.setState({ lat: GeolocationPosition.coords.latitude })
      },
      err => console.log(err)
    )

  }
  render() {
    return <h1> Latitude: { this.state.lat }</h1>
  }
}
export default App
